function Appp() {
    return (
        <div>
            <ul>
                <li>
                    <Link to="./a">home</Link>
                    <Link to="./b">about</Link>
                    <Link>servises</Link>
                    <Link>contacted us</Link>
                </li>
            </ul>
        </div>
    )

}
